<div class="iteminfo_area">
<div class="iteminfo_title">
<p>商品説明</p>
</div>
<div>
<p><p style="margin:0;"><strong>タイガー ステンレスランチジャー　おすすめポイント</strong><br>
1）まほうびん構造とポーチ断熱構造<br>
真空二重構造の保温容器と保温力を高めるポーチ断熱構造で、温かいごはんが長時間キープ。<br>
<br>
2）「横置き収納」で持ち運びもラクラク飯器、菜入れをそれぞれ横置きにしてポーチに収められるので、持ち運びにも最適。<br>
<br>
3）使いやすくて、お手入れ簡単<br>
容器にAg抗菌加工を施していますので、いつでも清潔！食器洗浄機・食器乾燥機OKでお手入れも簡単。</p></p>
</div>
</div>

<div id="kettle" class="spec_area">
<div class="spec_title">
<p>機能項目</p>
</div>
<table cellpadding="0" cellspacing="0">
<tr>
<th>機種名</th>
<td>LWY-E461K</td>
</tr>
<tr>
<th>色柄</th>
<td>（K）ブラック</td>
</tr>
<tr>
<th>本体サイズ（約）（幅×奥行き×高さ）</th>
<td>22.2×11.1×13.6cm（ポーチを含まない数値です）</td>
</tr>
<tr>
<th>本体質量（約）</th>
<td>0.65kg（ポーチを含む数値です）</td>
</tr>
<tr>
<th>実容量</th>
<td>【飯器】0.46L（お茶碗約2.3杯分）<br>【おかず容器】0.26L×2</td>
</tr>
<tr>
<th>保温効力<span style="font-size:10px; color:#FA002D;">（※）</span></th>
<td>6時間：54度以上<br>6時間：58度以上（専用ポーチ使用時）</td>
</tr>
</table>

<p class="comment_area">※ 保温効力とは、室温20度±2度において保温容器に熱湯を満たし、製品付属の飯器ふたをして縦置きにした状態で湯温が95度±1度の時から6時間放置した場合におけるその湯の温度です。</p>
